var wAccord = angular.module( "wAccordMovie",[]);

wAccord.controller( "wAccordMovieController", function( $scope ) {
	var dq = new DataQuery( 'qGetUsersAccordion' );
dq.execute().
	done( function() {
		$scope.$apply(function() {
			$scope.accordion_data = dq.getData();
		});
	});

});
